import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Login from './pages/Login';
import Register from './pages/Register';
import Dashboard from './pages/Dashboard';
import Booking from './pages/Booking';
import AppointmentBooking from './pages/AppointmentBooking';
import Doctor from './pages/Doctor';
import ManageLocations from './pages/ManageLocations'; // ✅ Newly added

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Login />} />
        <Route path="/login" element={<Login />} />
        <Route path="/register" element={<Register />} />
        <Route path="/dashboard" element={<Dashboard />} />
        <Route path="/book/:id" element={<AppointmentBooking />} />
        <Route path="/booking" element={<Booking />} />
        <Route path="/choose-doctor" element={<Doctor />} />
        <Route path="/manage-locations" element={<ManageLocations />} /> {/* ✅ New route */}
      </Routes>
    </Router>
  );
}

export default App;
